import "./style.css";

const CreatePostPopup = () => {
  return (
    <div className="blur">
      <div className="postBox">
        <div className="box_header">
          <div className="box_circle">
            <div className="exit_icon"></div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CreatePostPopup;
